import React, {Component} from 'react';
import 'tachyons';


class Home extends Component {
    render(){
        return(
            <div className='dib w-100 border-box fl w-100'>
                {/* <section className ='dib pa6 mr3 fl w-14'></section> */}
                <section className ='center w-100-m w-75-l o-90 black bg-green pr2 pl3 pt1 pb2'>
                    <div>
                    <article>
                            <h2 className='about tc'>Aakruthi</h2>
                            <p>
                            Forever the forerunner in imparting quality education, the Department of electronics and Communication Engineering has been persistent and consistent in catering the needs of the industry the best. In keeping up this spirit, to foster creativity and innovation a group of students from this department with support and guidance of the faculty, has initiated the Technical Symposium AAKRUTHI in 2000. Thanks to their bold initiative and unparalleled efforts, this event is being organized year since then, up holding their vision and aspirations. </p>

<p>The event’s pivotal motive has been to encourage students to confront practical problems and mobilize their skills towards devising an optimal solution. The event undoubtedly has served as a platform where students can explore themselves and set a righteous path for their bright careers. </p>

<p>The event has been eliciting an overwhelming response from students from different parts of both T.S and A.P and also other states. The student organizing committees have been striving to improve the fest in terms of the number of events, better organization and hospitality and wider scope to showcase one’s abilities.</p>


                        </article>
                        <article>
                            <h2 className='about tc'>Osmania University</h2>
                            <p>
                            Osmania University, established in 1918, is the seventh oldest in India, the third oldest in South India and the first to be established in the erstwhile princely state of Hyderabad. Throughout its existence of over eight decades, it has shown remarkable progress and sustained an integrated development of not only the region but also of the country.
                            </p>
                            <p>Its Alumni have distinguished themselves nationally and internationally in various spheres of life and spread far and wide around the world. With a sprawling campus of nearly 1600 acres and buildings of majestic beauty and architectural splendor, Osmania University, is perhaps the largest higher education system in the country.</p>
                            <p>Its is a home to nearly 300,000 students pursuing their higher studies in its Campus, Constituent, Affiliated colleges and District centers. Its faculty and staff number is nearly 5000. It is a multi-multidisciplinary university, offering rich and varied courses in the fields of Humanities, Arts, Sciences, Social Sciences, Law, Engineering, Technology, Commerce and Business management, Information Technology and Oriental Languages. The University’s strategic planning, teaching-and-learning policies and research direction have always emphasized respect for the concerns of the society and the need to address the issues that challenge it.</p>
                            <p>In recognition of its excellent academic achievements, Osmania University had the distinction of being awarded the ‘A+’ Grade status by the National Accreditation and Assessment Council (NAAC) of The University Grants Commission, Government of India in the year 2018.</p>
                            <p>One of the prime endeavors of the University has been to bring- in required changes in course contents along with innovations in the delivery of Higher Education. Consequently appropriate design and introduction of new courses, those are so essential for an active engagement with the community around, have always been its hallmark.</p>

                        </article>
                        <article>
                            <h2 className='about tc'>ECE Department</h2>
                            <p>Established in 1959, as the first department specializing in the field of Electronics and Communication, the Department of E.C.E, O.U.C.E, has scaled unprecedented heights in nurturing technical expertise and delivering quality professionals to the industry.</p>
                            <p>The Department has also contributed learning modules in the areas of communications, Digital Signal Processing and Network Theory as a part of the SONET program. It has been at the forefront in organizing institutional training courses for scientists of various R&D institutions and National level associations.</p>
                        </article>
                    </div>
                </section>
                {/* <section className ='dib m0 mb0 pa5 fl w-15'></section> */}
            </div>
        );
    }
}

export default Home;
